import React from 'react';
import ReactDOM from 'react-dom';

FahrenheitInput = () =>{
  return(
    <input 
    type="Number" 
    id="fahrenheit"
    />
  );
}
CelsiusInput = () =>{
  return(
    <input 
    type="Number" 
    id="celsius"
    />
  );
}

class App extends React.Component{
render(){
    return(
      <div>
        <h2>
          Temperature Conversion
        </h2>
        <FahrenheitInput/>
        <CelsiusInput/>
      </div>
    );
  }
}


ReactDOM.render(
    <App />,
  document.getElementById('root')
);
